import React from 'react';
class NavPage extends React.Component {
    constructor(props){
        super(props);
        this.state = {
        isLoading: true, 
        data: []
        }
    }  

    componentDidMount() {
        const requestOptions = {
            method:'GET',
            headers: { 
                'Authorization' : 'Bearer AAAAAAAAAAAAAAAAAAAAADz8bgEAAAAAxNvthHQruHUfKKHMD%2BKWdpY%2BHJo%3DcS5KFdL1hXZiMWgKuEj6QNGdFLJBFrkSsPL2lkzAMdQQ1k4Y5h',
                'Access-Control-Allow-Origin' : 'http://localhost:3000',
                'Access-Control-Allow-Methods' : 'POST, GET',
                'Access-Control-Max-Age' : '1000',
                'Access-Control-Allow-Credentials': 'true',
                'Access-Control-Allow-Headers' : 'x-requested-with, Content-Type, origin, authorization, accept, client-security-token'
            },
            mode: 'cors'    
        };
        fetch('https://api.twitter.com/2/tweets/1516462885291057153', requestOptions)
        .then((response) => response.json())
        .then((responseJson) => {
            this.setState({data: responseJson.data, isLoading: false});
        })
        .catch((error) => {
          console.error(error);
        });

    }
    render(){
        return (<div className="section-nav">
        <ul>
          <li><a href="https://stackoverflow.com">Stack Overflow</a></li>
        </ul>
        <div>
        {this.state.data.map(item => <div>{item.text}</div>)}
        </div>
        </div>) ; 

    }
}
export default NavPage;
